const char* knn_get_name(int16_t code) {
    if(code < NUMBER_OF_GESTURES) {
        return knn_gesture_names[code];
    }
    return "";
}


void knn_normalize(float *values, float *results) {
    for(int i = 0; i < KNN_FEATURES_COUNT; ++i) {
        results[i] = (values[i] - stored_means[i]) / stored_stds[i];
    }
}


float min2(const float x, const float y) {
    if(x < y) {
        return x;
    } else {
        return y;
    }
}


float min3(const float x, const float y, const float z) {
    if(x < y) {
        return min2(x, z);
    } else {
        return min2(y, z);
    }
}


float sum(const float arr[][DTW_SEQUENCE_LEN], int16_t size)
{
    float sum = 0;

    for(uint16_t i = 0; i < size; ++i) {
        for(uint16_t j = 0; j < DTW_SEQUENCE_LEN; ++j) {
            sum += arr[i][j];
        }
    }
    return sum;
}


float cityblock(const float x[DTW_SEQUENCE_LEN],const float y[DTW_SEQUENCE_LEN]) {
    float sum = 0;
    for(int i = 0; i < DTW_SEQUENCE_LEN; ++i) {
        sum += fabsf(x[i] - y[i]);
    }
    return sum;
}


float fastdtw(const float x[KNN_FEATURES_COUNT][DTW_SEQUENCE_LEN],const float y[KNN_FEATURES_COUNT][DTW_SEQUENCE_LEN]) {
    const float pos_inf = 1.0 / 0.0; // srsrly this is correct
    const int16_t size = KNN_FEATURES_COUNT;

    //  D0 = np.zeros(shape=(size + 1, size + 1))
    volatile float D0[KNN_FEATURES_COUNT + 1][KNN_FEATURES_COUNT + 1] = {0};
    //  D1 = D0[1:, 1:]

    for(int16_t i = 1; i <= size; ++i) {
        // D0[0, 1:] = np.inf
        D0[0][i] = pos_inf;
        // D0[1:, 0] = np.inf
        D0[i][0] = pos_inf;
    }

    //  D0[1:, 1:] = cdist(x, y, dist)
    for(int16_t i = 0; i < size; ++i) {
        for(uint16_t j = 0; j < size; ++j) {
            float cbvalue = cityblock(x[i], y[j]);
            D0[i + 1][j + 1] = cbvalue;
        }
    }

    // for i in range(size):
    for(uint16_t i = 0; i < size; ++i) {
        // for j in range(size):
        for(uint16_t j = 0; j < size; ++j) {
            // D1[i, j] += min(D0[i, j], D0[i, j + 1], D0[i + 1, j])
            D0[i + 1][j + 1] += min3(D0[i][j], D0[i][j + 1], D0[i + 1][j]);
        }
    }

    // return D1[-1, -1] / sum(D1.shape)
    float D1_shape_sum = size * 2;
    return D0[size][size] / D1_shape_sum;
}


//fja oblcizajaca koszt dopasowania odpowiednik ffastdtw
float distance(const float x1[KNN_FEATURES_COUNT][DTW_SEQUENCE_LEN],const float y[KNN_FEATURES_COUNT][DTW_SEQUENCE_LEN])
{
    return fastdtw(x1, y);
}


// implementacja https://docs.scipy.org/doc/numpy/reference/generated/numpy.argsort.html
// jako ze na potrzeba K indkesow najmniejszych elkementow i tylko K wieczatrzymuje sie wczesniej
// array to tablica z kosztami
// indices to tablica w ktorej zapisze znalezione indeksy (rosnaco)
// to jest odpowiednik
// indices = np.argsort(array)
// indices = indices[:K]
void part_argsort(float array[BATCH_SIZE], int indices[K])
{
    int used[BATCH_SIZE] = { 0 };

    for(int i = 0; i < K; i++)
    {
        int idx = -1;
        float val = +100000;

        for(int j = 0; j < BATCH_SIZE; j++)
        {
            if(array[j] < val && used[j] == 0)
            {
                val = array[j];
                idx = j;
            }
        }
        indices[i] = idx;
        used[idx] = 1;
    }
}

//wybiera najdzesiej pojawiajac sie element w tablicy (njr gestu)
// idices zawiera ktore elementy sprawdzc (jezeli K=3 to beda wybrane tylko te3 elementy
// z tablcy stored_y i wybrana najczesciej pojawiajaca sie tam wartosc)
// odpowiada
// labels = self.y[neighbours]
// (values, counts) = np.unique(labels, return_counts=True)
// ind = np.argmax(counts)
// pred = values[ind]  # prints the most frequent element
int get_most_frequent_in_array(int indices[K])
{
    int buckets[NUMBER_OF_GESTURES] = { 0 };

    for(int i = 0; i < K; i++)
    {
        int ind_i = indices[i];
        int bucket_id = stored_y[ind_i];
        buckets[bucket_id] = buckets[bucket_id] + 1;
    }

    int most_frequent = -1;
    int occurences = 0;
    for(int i = 0; i < NUMBER_OF_GESTURES; i++)
    {
        if(buckets[i] > occurences)
        {
            most_frequent = i;
            occurences = buckets[i];
        }
    }

    return most_frequent;
}


int16_t knn_classifier(const float X[KNN_FEATURES_COUNT][DTW_SEQUENCE_LEN])
{
    //oblicz odlegosc do kazdego zapamietanego elementu
    for(int idx = 0; idx < BATCH_SIZE; idx++) {
        costs[idx] = distance(stored_x[idx], X);
    }
    // to symuluje jakies wyniki
    //float costs[BATCH_SIZE] = {1,13,4,5,1,0,8,1,2,5,8};
    int indices[K]  = { 0 };
    part_argsort(costs,  indices);

    //zsumuj koszty K najblizszych elementow
    // odpowiada:
    // cost = np.sum(distances[neighbours])
    float sum_of_cost = 0.0f;

    for(int i = 0; i < K; i++) {
        sum_of_cost += costs[indices[i]];
    }
    //sprawdz czy kost dopasowania nie jest za duzy
    // if cost >= self.threshsold:
    //                 predictions[idx] = 'none'

    char msg[128];
    sprintf(msg, " KNN sum of costs= %f\r\n", sum_of_cost);
    TM_USART_Puts(USART6, msg);

    if(sum_of_cost > THRESHOLD) {
        return NO_GESTURE_DETECTED;
    }
     else {
        int gesture = get_most_frequent_in_array(indices);
        return gesture;
    }
}
